const apikey = "qliUqRdzYPcj7pkqNG8NzCVOU0UgyQvz";

const peticion = fetch(`https://api.giphy.com/v1/gifs/random?apikey=${apikey}`);
const peticion2 = fetch(
  `https://api.giphy.com/v1/gifs/random?apikey=${apikey}`
);

peticion
  .then((resp) => {
    resp.json().then((data) => {
      console.log(data.data.images.original.mp4);
    });
  })
  .catch((err) => {
    console.log(err);
  });

peticion2
  .then((resp) => resp.json())
  .then((data) => console.log(data.data.images.original.mp4))
  .catch((err) => {
    console.log(err);
  });
